query diseaseTargets($efoId: String!, $size: Int!) {
  disease(efoId: $efoId) {
    id
    name
    description
    associatedTargets(page: {size: $size, index: 0}) {
      rows {
        target {
          approvedSymbol
          id
          functionDescriptions
        }
        score
      }
    }
  }
}
